import React, { useState } from "react";

const Timer = () => {
  let [mins, setMins] = useState("00");
  let [secs, setSecs] = useState("30");
  return (
    <>
      <div className="time">
        {mins}:{secs}
      </div>
    </>
  );
}

export default Timer;
